import React from "react";
import MenuIcon from "@material-ui/icons/Menu";
import {
  AppBar,
  IconButton,
  Toolbar,
  Typography,
  Link,
} from "@material-ui/core";

export const Navbar = () => {
  return (
    <AppBar>
      <Toolbar>
        <IconButton edge="start" color="inherit">
          <MenuIcon />
        </IconButton>
        <Typography variant="h6">MovieDB</Typography>
        <Link variant="body2">New</Link>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
